import javax.swing.*;
import java.awt.*;
import java.awt.event.*;

public class MovingMessagePanel extends JPanel implements ActionListener, ItemListener, MouseMotionListener {

    String text = "";

    Color bgColor = Color.WHITE;
    Color textColor = Color.BLACK;
    int x = 110;
    int y = 200;
    JRadioButton colorWhite, colorBlack, useMouse;
    JButton leftBtn, rightBtn, upBtn, downBtn;
    JTextField textField;
    boolean moveM = false;

    public MovingMessagePanel() {
        setLayout(new BorderLayout());
        messagePanel();
        colorPanel();
        directionPanel();
        radButton();
        addMouseMotionListener(this);
    }

    public void messagePanel(){
        JPanel msg = new JPanel();
        msg.add(new JLabel("Message to be displayed "));
        textField = new JTextField(50);
        textField.addActionListener(this);
        msg.add(textField);
        add(msg, BorderLayout.NORTH);
    }

    public void colorPanel(){
        JPanel colorP = new JPanel();
        colorP.setLayout(new GridLayout(3, 1));
        colorP.add(new JLabel("Background Color"));

        ButtonGroup bg = new ButtonGroup();

        colorWhite = new JRadioButton("white");
        colorWhite.setSelected(true);
        colorWhite.addItemListener(this);

        colorBlack = new JRadioButton("black");
        colorBlack.addItemListener(this);

        bg.add(colorWhite);
        bg.add(colorBlack);

        colorP.add(colorWhite);
        colorP.add(colorBlack);

        add(colorP, BorderLayout.WEST);
    }

    public void directionPanel(){
        JPanel directionalP = new JPanel();
        add(directionalP, BorderLayout.SOUTH);

        leftBtn = new JButton("Left");
        rightBtn = new JButton("Right");
        upBtn = new JButton("Up");
        downBtn = new JButton("Down");

        leftBtn.addActionListener(this);
        rightBtn.addActionListener(this);
        upBtn.addActionListener(this);
        downBtn.addActionListener(this);

        directionalP.add(leftBtn);
        directionalP.add(rightBtn);
        directionalP.add(upBtn);
        directionalP.add(downBtn);
    }

    public void radButton(){
        useMouse = new JRadioButton("Use Mouse");
        add(useMouse, BorderLayout.EAST);
        useMouse.addItemListener(this);
    }

    @Override
    public void actionPerformed(ActionEvent e) {
        if (e.getSource() == textField)
            text = e.getActionCommand();

        if(e.getSource() == leftBtn)
            x -= 5;
        if(e.getSource() == rightBtn)
            x += 5;
        if(e.getSource() == upBtn)
            y -= 5;
        if(e.getSource() == downBtn)
            y += 5;

        repaint();
    }

    @Override
    protected void paintComponent(Graphics g) {
        super.paintComponent(g);

        g.setColor(bgColor);
        g.fillRect(110, 50, 780, 300);

        g.setColor(textColor);
        g.setFont(new Font("Arial", Font.BOLD, 60));
        g.drawString(text, x, y);

    }

    @Override
    public void itemStateChanged(ItemEvent e) {
        Object event = e.getSource();

        if(event == colorBlack) {
            bgColor = Color.BLACK;
            textColor = Color.ORANGE;
        }
        else if (event == colorWhite){
            bgColor = Color.WHITE;
            textColor = Color.BLACK;
        }

        if(event == useMouse && e.getStateChange() == ItemEvent.SELECTED) {
            System.out.println("Hi");
            moveM = true;
        } else if (event == useMouse && e.getStateChange() == ItemEvent.DESELECTED){
            moveM = false;
        }

        repaint();
    }

    @Override
    public void mouseDragged(MouseEvent e) {
        if (moveM) {
            x = e.getX();
            y = e.getY();
            repaint();
        }
    }

    @Override
    public void mouseMoved(MouseEvent e) {

    }
}

