bool is_prime(int x) {
	if (x <= 0)
		return false;
	for (int v = 2; v < sqrt(x); ++v) {
		if (x % v == 0)
			return false;
	}
	return true;
}

unsigned long long factorial(int x) {
	unsigned long long res = 1;
	if (x < 2)
		return res;
	while (x > 1) {
		res *= x;
		x -= 1;
	}
	return res;
}

void show_rectangle(int n, int k) {
	for (int y = 0; y < n; y++) {
		for (int x = 0; x < k; x++) {
			if (x == 0 || y == 0 ||
				x == k - 1 || y == n - 1)
				cout << "+";
			else
				cout << " ";
		}
		cout << endl;
	}
}


